import{_ as e,c as i,o as a,a4 as s}from"./chunks/framework.B94ikmwp.js";const g=JSON.parse('{"title":"Troubleshooting","description":"","frontmatter":{},"headers":[],"relativePath":"Troubleshooting.md","filePath":"Troubleshooting.md"}'),t={name:"Troubleshooting.md"},o=s('<h1 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h1><h2 id="ui5-server" tabindex="-1">UI5 Server <a class="header-anchor" href="#ui5-server" aria-label="Permalink to &quot;UI5 Server&quot;">​</a></h2><h3 id="chrome-redirects-http-urls-to-https-err-ssl-protocol-error" tabindex="-1">Chrome Redirects HTTP URLs to HTTPS (<code>ERR_SSL_PROTOCOL_ERROR</code>) <a class="header-anchor" href="#chrome-redirects-http-urls-to-https-err-ssl-protocol-error" aria-label="Permalink to &quot;Chrome Redirects HTTP URLs to HTTPS (`ERR_SSL_PROTOCOL_ERROR`)&quot;">​</a></h3><p>An HTTPS server or proxy that was previously running on a domain (e.g. <code>localhost</code>), might have set an HSTS header, enforcing Chrome to always use HTTPS for this domain. See <a href="https://www.chromium.org/hsts" target="_blank" rel="noreferrer">https://www.chromium.org/hsts</a>. This makes it impossible to connect to an HTTP-only server running on the same domain.</p><h4 id="resolution" tabindex="-1">Resolution <a class="header-anchor" href="#resolution" aria-label="Permalink to &quot;Resolution&quot;">​</a></h4><p>You need to delete the HSTS mapping in <a href="chrome://net-internals/#hsts" target="_blank" rel="noreferrer">chrome://net-internals/#hsts</a> by entering the domain name (e.g. <code>localhost</code>) and pressing &quot;delete&quot;.</p><h2 id="issues-not-listed-here" tabindex="-1">Issues Not Listed Here <a class="header-anchor" href="#issues-not-listed-here" aria-label="Permalink to &quot;Issues Not Listed Here&quot;">​</a></h2><p>Please follow our <a href="https://github.com/SAP/ui5-tooling/blob/main/CONTRIBUTING.md#report-an-issue" target="_blank" rel="noreferrer">Contribution Guidelines</a> on how to report an issue.</p><h2 id="ui5-project" tabindex="-1">UI5 Project <a class="header-anchor" href="#ui5-project" aria-label="Permalink to &quot;UI5 Project&quot;">​</a></h2><h3 id="ui5-taking-too-much-disk-space" tabindex="-1"><code>~/.ui5</code> Taking too Much Disk Space <a class="header-anchor" href="#ui5-taking-too-much-disk-space" aria-label="Permalink to &quot;`~/.ui5` Taking too Much Disk Space&quot;">​</a></h3><p>There are possibly many versions of UI5 framework dependencies installed on your system, taking a large amount of disk space.</p><h4 id="resolution-1" tabindex="-1">Resolution <a class="header-anchor" href="#resolution-1" aria-label="Permalink to &quot;Resolution&quot;">​</a></h4><p>Remove the <code>.ui5/framework/</code> directory from your user&#39;s home directory:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -rf</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ~/.ui5/framework/</span></span></code></pre></div><p>Any missing framework dependencies will be downloaded again during the next UI5 Tooling invocation.</p><h2 id="environment-variables" tabindex="-1">Environment Variables <a class="header-anchor" href="#environment-variables" aria-label="Permalink to &quot;Environment Variables&quot;">​</a></h2><h3 id="changing-the-log-level" tabindex="-1">Changing the Log Level <a class="header-anchor" href="#changing-the-log-level" aria-label="Permalink to &quot;Changing the Log Level&quot;">​</a></h3><p>In CI environments or in a combination with other tools, the usage of <a href="https://sap.github.io/ui5-tooling/stable/pages/CLI/#common-options" target="_blank" rel="noreferrer">UI5 CLI&#39;s <code>--log-level</code></a> command parameter might be inconvenient and even impossible.</p><h4 id="resolution-2" tabindex="-1">Resolution <a class="header-anchor" href="#resolution-2" aria-label="Permalink to &quot;Resolution&quot;">​</a></h4><p>Replace UI5 Tooling&#39;s <code>--log-level</code> option with the <code>UI5_LOG_LVL</code> environment variable.</p><p>Example:</p><p><code>UI5_LOG_LVL=silly ui5 build</code></p><p>On Windows:</p><p><code>set UI5_LOG_LVL=silly ui5 build</code></p><p>Cross Environment via <a href="https://www.npmjs.com/package/cross-env" target="_blank" rel="noreferrer">cross-env</a>:</p><p><code>cross-env UI5_LOG_LVL=silly ui5 build</code></p><p>UI5 + Karma:</p><p><code>cross-env UI5_LOG_LVL=verbose npm run karma</code></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The combination of the <code>UI5_LOG_LVL</code> environment variable with the <code>--log-level</code> CLI parameter might lead to unexpected results; they should be used interchangeably but not together. The CLI parameter takes precedence over the <code>UI5_LOG_LVL</code> environment variable.</p></div><h3 id="changing-ui5-tooling-s-data-directory" tabindex="-1">Changing UI5 Tooling&#39;s Data Directory <a class="header-anchor" href="#changing-ui5-tooling-s-data-directory" aria-label="Permalink to &quot;Changing UI5 Tooling&#39;s Data Directory&quot;">​</a></h3><p>UI5 Tooling&#39;s data directory is by default at <code>~/.ui5</code>. It&#39;s the place where the framework artifacts are stored. In some cases and environments this is not a convenient location and the user needs to provide a better one.</p><p>The path to it can either be provided via environment variable or permanently set in the configuration.</p><div class="tip custom-block"><p class="custom-block-title">Info</p><p>Paths are resolved relative to the current root project path (i.e. where the package.json is located).</p></div><h4 id="environment-variable-ui5-data-dir" tabindex="-1">Environment variable <code>UI5_DATA_DIR</code> <a class="header-anchor" href="#environment-variable-ui5-data-dir" aria-label="Permalink to &quot;Environment variable  `UI5_DATA_DIR`&quot;">​</a></h4><p>Unix:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">UI5_DATA_DIR</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">/my/custom/location/.ui5</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> ui5</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> build</span></span></code></pre></div><p>Windows:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">set</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> UI5_DATA_DIR=&quot;C:</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">\\\\</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">my</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">\\\\</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">custom</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">\\\\</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">location</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">\\\\</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">.ui5&quot;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ui5</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> build</span></span></code></pre></div><h4 id="configuration-ui5datadir" tabindex="-1">Configuration <code>ui5DataDir</code> <a class="header-anchor" href="#configuration-ui5datadir" aria-label="Permalink to &quot;Configuration `ui5DataDir`&quot;">​</a></h4><p>Configure a custom directory:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">ui5</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> config</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> set</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ui5DataDir</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /my/custom/location/.ui5</span></span></code></pre></div><p>Unset the configuration to switch back to the default directory:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">ui5</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> config</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> set</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ui5DataDir</span></span></code></pre></div>',43),n=[o];function r(l,h,d,p,c,u){return a(),i("div",null,n)}const m=e(t,[["render",r]]);export{g as __pageData,m as default};
